import React from "react";
import Carousel from "../Carousel/Carousel";

const about = props => (
  <div>
    <Row>
      <Col>
        <p>About</p>
      </Col>
      <Col>
        <div className="about__contents">{props.content}</div>
      </Col>
      <Col lg={{ span: 3, offset: 2 }} sm={12}>
        <Carousel images={props.images} />
      </Col>
    </Row>
  </div>
);

export default about;
